import { Button, TextField } from '@mui/material';
import Box from '@mui/material/Box';
import Checkbox from '@mui/material/Checkbox';
import React from 'react';


const Form = () => {
    function RedBar() {
        return (
          <Box
            sx={{
              height: 20,
              backgroundColor: 'transparent'
            }}
          />
        );
      }
  return (
    <div className="form">
    <div>
        <h2>Create an account</h2>
    </div>
      <form>
        <TextField fullWidth label='Email Address' placeholder="Enter your Email Address" />
        <RedBar/>
        <TextField fullWidth label='Password' placeholder="Enter your Password" />
        <RedBar/>
        <TextField fullWidth label='Confirm Password' placeholder="Enter your Confirm Password" />
        <RedBar/>
        <TextField fullWidth label='Name' placeholder="Enter your Name" />
        <RedBar/>
        <TextField label='phone' placeholder="Enter your Phone Number" />
        <RedBar/>
        <Checkbox>I have read and agree Terms and Conditions</Checkbox>
        <RedBar/>
        <Button type='submit' variant='contained' color='primary'>Sign up</Button>
      </form>
    </div>
  )
}

export default Form;
